        <Container fluid style={{position: 'relative'}}>
            <div>
                <Row>
                    <img src={ContactImg}></img>
                </Row>
            </div>
            <div>
                <Row>
                    {/* insert map here... idk how to? */}
                </Row>
            </div>
        </Container>
    )
}

export default Contact
